const Card = ({ pg, onClick }) => (
  <div className="card" onClick={onClick}>
    <img src={pg.image} alt={pg.name} />
    <h3>{pg.pgName}</h3>
    <p className="owner">Owner: {pg.ownerName}</p>
    <button className="details">View Details</button>
  </div>
);

export default Card;
